        const getdata = async () => {
          const res = await axios.get("https://first-blog123.herokuapp.com/api/top")
          setstories(res.data);
          console.log(res.data);
        }
        getdata();
      }, [])

    return (
        <div className='adjust-all'>
            <Latestheading data={{ name1: "Technology" }} />
